import './style.css';
import React from 'react';
import angry from './angry.jpg';

function UniqloPage() {
  return (
    <div className="App-header">
      <h2 className="name">UNIQLO App Redesign</h2>
        <div className="intro">
          I'm a UNSW Information Systems/Commerce student that is an aspiring product
          and UI designer. Check out some of my work below!
        </div>
    </div>
  );
}

export default UniqloPage;
